import React, { useEffect, useState, useRef } from "react";

const PAGE_SIZE = 3;
const TOTAL_DATA_COUNT = 100;

// Function to generate mock data with random values
const generateMockData = (count) => {
  const mockData = [];
  for (let i = 0; i < count; i++) {
    mockData.push({
      id: i + 1,
      name: `Crypto ${i + 1}`,
      symbol: `CRYP${i + 1}`,
      current_price: Math.random() * 1000, // Random price between 0 and 1000
      market_cap: Math.random() * 1000000000, // Random market cap between 0 and 1 billion
    });
  }
  return mockData;
};

// Custom hook to stop loading data when container height exceeds window height
const useStopLoadingOnExceedHeight = (containerRef) => {
  const [loading, setLoading] = useState(true);
  const [coinsData, setCoinsData] = useState([]);

  useEffect(() => {
    const container = containerRef.current;

    // Function to load initial data
    const loadInitialData = () => {
      const windowHeight = window.innerHeight;
      const containerHeight = container.scrollHeight;

      if (containerHeight <= windowHeight) {
        const mockData = generateMockData(PAGE_SIZE);
        setCoinsData((prevData) => [...prevData, ...mockData]);
      } else {
        setLoading(false); // Stop loading data when container height exceeds window height
      }
    };

    // Function to load data while scrolling
    const loadData = () => {
      const mockData = generateMockData(PAGE_SIZE);
      setCoinsData((prevData) => [...prevData, ...mockData]);
    };

    // Scroll event listener for infinite scrolling
    const handleScroll = () => {
      if (!loading) {
        loadData();
      }
    };

    container.addEventListener("scroll", handleScroll);
    loadInitialData(); // Load initial data

    return () => {
      container.removeEventListener("scroll", handleScroll);
    };
  }, [containerRef, loading]);

  return loading;
};

const App = () => {
  const containerRef = useRef(null);

  // Custom hook to stop loading data when container height exceeds window height
  const loading = useStopLoadingOnExceedHeight(containerRef);

  return (
    <div className="app">
      <h1>Crypto Gallery</h1>
      <div className="crypto-list" ref={containerRef}>
        {coinsData.map((crypto) => (
          <div key={crypto.id} className="crypto-item">
            <h3>{crypto.name}</h3>
            <p>Symbol: {crypto.symbol}</p>
            <p>Price: ${crypto.current_price.toFixed(2)}</p>
            <p>Market Cap: ${crypto.market_cap.toFixed(2)}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default App;
